import React from "react";

import login from"./login"

import ReactDom from "react-dom";
import App from "./App"
import"./index.css";
import {BrowserRouter} from "react-router-dom";



ReactDom.render(
  <>
  <login/>
  <BrowserRouter>
  <App/>
  </BrowserRouter>
  </>,
  document.getElementById("root")
);
